import styled from 'styled-components'

const StyledBurger = styled.div`
    width: 2rem;
    height: 2rem;
    postion; fixed;
    top: 15px;
    right: 20px;
    
    
    div{
        width: 2rem;
        height: 0.25rem;
        backgrund-color: #333;
    }
`


const Burger = () => {
    return ( 
        <StyledBurger>
            <div></div>
            <div></div>
            <div></div>
        </StyledBurger>
    );
}
 
export default Burger;
